script: |
  super -f text -I q10136.spq | sort > q10136.out

inputs:
  - name: q10136.spq
    data: |
      SELECT - col2 * + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN cor0.col1 AND + col1 * + col1 OR NULL IN ( - col2 );
  - name: tab1

outputs:
  - name: q10136.out
    data: |
